import React from 'react';

const Calibration = () => {
   confirmClick = () => {
      console.log("clicked")
   };

    return (
       <main>
          <div className="jumbotron">
            <h1 className="ml-4">I confirm my volume is 50%</h1>
            <button type="submit" className="btn btn-success" onClick={this.confirmClick}>Finished</button>
          </div>
       </main>
    );
}

export default Calibration;
